    false,nt"url": null,nt"notes": "This dataset is comprised of forty-five
    entities that are part of the United States Federal Reserve System according to
    the United States Department of Treasury. The Federal Reserve System is comprised
    of twelve Federal Reserve Banks and twenty-five Federal Reserve Branches. This data
    set contains all of the banks and branches as well as some check processing centers
    and offices that are affiliated with the US Federal Reserve System. This dataset
    does not contain the Federal Reserve Headquarters in Washington DC because it is
    an 'Administration Only' location. There is an entity within this dataset that is
    also included in the HSIP Gold Bullion Repositories 2006 Q3 dataset as the entity
    is considered to be a bullion repository as well as a Federal Reserve. The currentness
    of this dataset is indicated by the more recent date of the [CONTDATE] attribute
    and/or the [GEODATE] attribute. Based upon these attributes the oldest record dates
    from 07/19/2006 and the newest record dates from 08/04/2006. The most current [CONTDATE]
    is the most current contact date as provided by TGS. Due to the sensitive nature
    of these entities, TGS did not make contact with the entities within this dataset
    during this processing.",nt"license_title": "License Not Specified",nt"extras":
